// изменение фона слайда
function changeSlideBackground(
    editor: EditorType,
    {
        value, type,
    }: { value: string; type: string },
): EditorType {
    const newEditor = {...editor}
    const slideId = editor.selection.selectedSlideId
    let thisSlide = newEditor.presentation.slides.find((s) => s.id === slideId)!
    const indexOfSlide = newEditor.presentation.slides.indexOf(thisSlide)
    thisSlide = setSlideBackground(thisSlide, value, type)
    newEditor.presentation.slides[indexOfSlide] = thisSlide
    return newEditor
}

function setSlideBackground(
    slide: SlideType,
    value: string,
    type: string,
): SlideType {
    let newBackground: BackgroundType
    if (type === 'solid') {
        newBackground = {
            hexColor: value,
            type: 'solid',
        }
        return {
            ...slide,
            background: newBackground,
        }
    }
    if (type === 'image') {
        newBackground = {
            src: value,
            type: 'image',
        }
        return {
            ...slide,
            background: newBackground,
        }
    }
    return {...slide}
}

function setSelection(
    editor: EditorType,
    action: SetSelectionAction,
): EditorType {
    switch (action.payload.type) {
    case 'slide':
        return {
            ...editor,
            selection: {
                ...editor.selection,
                selectedSlideId: action.payload.id,
            },
        }
    case 'object':
        return {
            ...editor,
            selection: {
                ...editor.selection,
                selectedObjIds: [...editor.selection.selectedObjIds, action.payload.id],
            },
        }
    default:
        return {...editor}
    }
}

function deselect(
    editor: EditorType,
    action: DeselectAction,
) {
    switch (action.payload.type) {
    case 'slide':
        return {
            ...editor,
            selection: {
                selectedSlideId: '',
                selectedObjIds: [],
            },
        }
    case 'object':
        return {
            ...editor,
            selection: {
                ...editor.selection,
                selectedObjIds: [],
            },
        }
    default:
        return {...editor}
    }
}

function getUID(): string {
    return (
        Math.random().toString(36).substring(2, 15) +
		Math.random().toString(36).substring(2, 15)
    )
}

function getDefaultBackground(): BackgroundType {
    const defaultSolid: BackgroundType = {
        hexColor: '#FFFFFF',
        type: 'solid',
    }
    return defaultSolid
}
function getDefaultText() {
    const defaultSize: SizeType = {
        width: 200,
        height: 100,
    }
    const defaultText: TextType = {
        id: getUID(),
        size: defaultSize,
        position: {
            x: 0,
            y: 0,
        },
        value: 'Default text',
        fontSize: 11,
        fontFamily: 'TimesNewRoman',
        hexColor: '#000000',
        type: 'text',
    }
    return defaultText
}

function findSlideById(editor: EditorType, id: string): SlideType {
    return editor.presentation.slides.find((s) => s.id === id)!
}

export {
    changePresentationName,
    addSlide,
    deleteSlide,
    changeSlidePosition,
    setSlideIndex,
    addText,
    addPicture,
    changeObjectPosition,
    changeObjectSize,
    changeTextValue,
    changeTextFontSize,
    changeTextFontFamily,
    changeTextColor,
    changeSlideBackground,
    getUID,
    getDefaultBackground,
    deleteObjects,
    setSelection,
    deselect,
}

function getB64Pic() {
    return 'data:image/jpeg;base64,'
}
